In rectangle $ABCD$, angle $C$ is trisected by $\overline{CF}$ and $\overline{CE}$, where $E$ is on $\overline{AB}$, $F$ is on $\overline{AD}$, $BE = 6,$ and $AF = 2$. Which of the following is closest to the area of the rectangle $ABCD$?\\

\begin{asy}
import olympiad;
import cse5;
defaultpen(white);
size(100);

size(140);
pair A, B, C, D, E, F, X, Y;
real length = 12.5;
real width = 10; 
A = origin;
B = (length, 0);
C = (length, width);
D = (0, width);
X = rotate(330, C)*B;
E = extension(C, X, A, B);
Y = rotate(30, C)*D;
F = extension(C, Y, A, D);
draw(E--C--F);
label("$2$", A--F, dir(180));
label("$6$", E--B, dir(270));

draw(A--B--C--D--cycle);
dot(A);dot(B);dot(C);dot(D);dot(E);dot(F);
label("$A$", A, dir(225));
label("$B$", B, dir(315));
label("$C$", C, dir(45));
label("$D$", D, dir(135));
label("$E$", E, dir(270));
label("$F$", F, dir(180));

\end{asy}
